function KeyBoard(){
    const top_keys = ["Q","W","E","R","T", "Y", "U", "I", "O", "P"]
    const mid_keys = ["A","S","D","F","G","H","J","K","L"]
    const low_keys = ["Z","X", "C", "V", "B", "N", "M"]

    return (<div className = "container">
        <div className= "keyboard">
            <div className = "line1">{top_keys.map((key)=>{
                return <button className= "key">{key}</button>
                })}
            </div>
            <div className = "line2">{mid_keys.map((key)=>{
                return <button className= "key">{key}</button>
                })}
            </div>
            <div className = "line3">{low_keys.map((key)=>{
                return <button className= "key">{key}</button>
                })}
            </div>
    </div>
    </div>
       )
}
export default KeyBoard;
